import Categories from '../../components/categories/Categories'
import React, { useState, useEffect } from 'react';


const Catalog = () => {
  

    return (
        <>
        <Header />
        {/* <ExHeader /> */}
       
        <Categories />

        
        <Products />
       
        <Footer />
        </>
    );
}

export default Catalog;
